    true,nt"url": null,nt"notes": "<p>NNDSS - Table IV. Tuberculosis - 2014.This
    Table includes total number of cases reported in the United States, by region and
    by states, in accordance with the current method of displaying MMWR data.  Data
    on United States will exclude counts from US territories.  Footnote:C.N.M.I.: Commonwealth
    of Northern Mariana Islands. U: Unavailable.    -: No reported cases.    N: Not
    reportable.    NN: Not Nationally Notifiable    Cum: Cumulative year-to-date counts.
       Min: Minimum.    Max: Maximum. * Case counts for reporting year 2013 and 2014
    are provisional and subject to change. For further information on interpretation
    of these data, see <a href="http://wwwn.cdc.gov/nndss/document/ProvisionalNationaNotifiableDiseasesSurveillanceData20100927.pdf">http://wwwn.cdc.gov/nndss/document/ProvisionalNationaNotifiableDiseasesS...</a>
